import Link from 'next/link'
const Navbar= ()=> (
   <div> 
     <ul>
           <li>
               <Link href="/">Home</Link>

           </li>
           <li>
               <Link href="/about">About</Link>

           </li>
       </ul>
       <style jsx>
           {`
           ul{
               background:#333;
               color:#FFFFFF;
               list-style:none;
               display:flex;
           }
           ul li{
               font-size:30px;
               margin-right:500px;
           }
           ul li a{
               color:#FFFFFF;
               text-decoration:none;
           }
           `}
       </style>



           </div>
)

export default Navbar
